import React from 'react';
import { Button } from 'reactstrap';

export class LoadButton extends React.Component {
  render() {
    return (
      <div>
        <Button 
        color="primary" 
        className="d-flex flex-column" 
        onClick={this.props.onClick}>Load More</Button>
      </div>
    );
  }
}
